import React from 'react';
import { Redirect, Route } from 'react-router-dom';
import { IonApp, IonRouterOutlet } from '@ionic/react';
import { IonReactRouter } from '@ionic/react-router';
import Home from './pages/Home';
import AllartSelect from './pages/AllartSelect';

/* Core CSS required for Ionic components to work properly */
import '@ionic/react/css/core.css';

/* Basic CSS for apps built with Ionic */
import '@ionic/react/css/normalize.css';
import '@ionic/react/css/structure.css';
import '@ionic/react/css/typography.css';

/* Optional CSS utils that can be commented out */
import '@ionic/react/css/padding.css';
import '@ionic/react/css/float-elements.css';
import '@ionic/react/css/text-alignment.css';
import '@ionic/react/css/text-transformation.css';
import '@ionic/react/css/flex-utils.css';
import '@ionic/react/css/display.css';

/* Theme variables */
import './theme/variables.css';
import DoorFurniture from './pages/DoorFurniture';
import CabinetFurniture from './pages/CabinetFurniture';
import DoorBoltsandCremone from './pages/DoorBoltsandCremone';
import WindowFurniture from './pages/WindowFurniture';
import Miscellaneous from './pages/Miscellaneous';
import FinishesandPatinas from './pages/FinishesandPatinas';
import Indexes from './pages/Indexes';
import Contact from './pages/Contact';
import ProductGallery from './pages/ProductGallery';

const App: React.FC = () => (
  <IonApp>
  <IonReactRouter>
        <IonRouterOutlet id="main">
          <Route path="/home" component={Home} exact={true} />
          <Route path="/AllartSelect" component={AllartSelect} exact={true} />
          <Route path="AllartSelect/ProductGallery" component={ProductGallery} exact={true} />
          <Route path="/DoorFurniture" component={DoorFurniture} exact={true} />
          <Route path="/CabinetFurniture" component={CabinetFurniture} exact={true} />
          <Route path="/DoorBoltsandCremone" component={DoorBoltsandCremone} exact={true} />
          <Route path="/WindowFurniture" component={WindowFurniture} exact={true} />
          <Route path="/Miscellaneous" component={Miscellaneous} exact={true} />
          <Route path="/FinishesandPatinas" component={FinishesandPatinas} exact={true} />
          <Route path="/Indexes" component={Indexes} exact={true} />
          <Route path="/Contact" component={Contact} exact={true} />
          <Route exact path="/" render={() => <Redirect to="/home" />} />
        </IonRouterOutlet>
  </IonReactRouter>
</IonApp>
);


export default App;
